import { useRef } from 'react'

const MenuItem = ({
  className, 
  item,
  onSectionToScroll
}) => {
  const targetSection = useRef(null)

  return (
    <li className={`${className}__item`}>
      <button
        onClick={onSectionToScroll}
      >
        <span>{item.data}</span>
      </button>
    </li>
  )
}

export default MenuItem
